import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';

import { HttpClientModule } from '@angular/common/http';
import { AppRoutingModule } from './app-routing.module';
import { AppComponent } from './app.component';
import { PlotDetailComponent } from './plot-detail/plot-detail.component';
import { SensorIntegrationComponent } from './sensor-integration/sensor-integration.component';
import { PlotListComponent } from './plot-list/plot-list.component';
import { PlotEditComponent } from './plot-edit/plot-edit.component';
import { PlotAddComponent } from './plot-add/plot-add.component';
import { FormsModule } from '@angular/forms';
@NgModule({
  declarations: [
    AppComponent,
    PlotListComponent
    PlotEditComponent,
    PlotAddComponent,

    PlotDetailComponent,
    SensorIntegrationComponent
  ],
  imports: [
    BrowserModule,
    HttpClientModule,
    FormsModule,
    AppRoutingModule
  ],
  providers: [],
  bootstrap: [AppComponent]
})
export class AppModule { }
